import React, { Component } from 'react'

const addClientFields = {
    "nameField": "",
    "addressField": "",
};

let test2d = [
    ["Sawyer", "123", "Sherlock"],
    ["Mack", "543", "Arizone"],
    ["Ty", "785", "Wash"]
];

let temp1darray = [];

class ClientListAttempt2 extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             
        }
    }

    sort2dArr = (a, b) => {
        test2d.sort(function(a,b) {
            return a[0]-b[0]
        });
    }

    handleNameInput = (event) => {
        addClientFields["nameField"] = event.target.value;
    }
    handleAddressInput = (event) => {
        addClientFields["addressField"] = event.target.value;
    }

    handleNewClientBtnPress = (event) => {
        // temp1darray.push(addClientFields["nameField"]);
        // console.log(addClientFields["nameField"]);
        // // temp1darray.push(addClientFields["addressField"]);
        // console.log(temp1darray);
        // test2d.push(temp1darray);
        // //SUCCESSFUL sorting of 2d array
        // test2d.sort(this.sort2dArr);
        // console.log(test2d);
        this.arrayManagementHelper();
        this.sort2dArr
        this.consolelogHelper();
    }

    arrayManagementHelper = () => {
        temp1darray[0] = addClientFields["nameField"];
        console.log(temp1darray);
        test2d.push(temp1darray);
    }

    clearTempArray = () => {
        temp1darray.length = 0;
    }

    consolelogHelper = () => {
        console.log(test2d);
    }

    render() {
        return (
            <div>
                <div className="addclient-container">
                    <div className="label-input-container">
                        <label>Name</label>
                        <input type="text" className="addclient-input-fields" id="addclient-name-input" onInput = {this.handleNameInput}></input>
                    </div>
                    <div className="label-input-container">
                        <label>Address</label>
                        <input type="text" className="addclient-input-fields" id="addclient-address-input" onInput = {this.handleAddressInput}></input>
                    </div>
                    <div>
                        <button onClick = {this.handleNewClientBtnPress}>click</button>
                    </div>
                    <div>
                        <button onClick = {this.clearTempArray}>clearTempArray</button>
                    </div>
                </div>
                <div className="ui-database-container">
                    <div className="ui-database-row-container">
                        
                    </div>
                </div>
            </div>
        )
    }
}

export default ClientListAttempt2
